import React, { useState } from "react";

function Toggele() {
  const [data, setData] = useState(true);
  return (
    <div>
      {data ? <h1>toggale the data</h1> : null}

      <button onClick={() => setData(false)}>hide</button>
      <button onClick={() => setData(true)}>show</button>
    </div>
  );
}

export default Toggele;
